import React, { useState, useEffect } from 'react';
import { Button, Form, Container, Row, Col, Alert } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

function Auth() {
  const [isLogin, setIsLogin] = useState(true);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [name, setName] = useState('');
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const isLoggedIn = localStorage.getItem('isLoggedIn');
    if (isLoggedIn) {
      navigate('/diagnosis');
    }
  }, [navigate]);

  const handleLoginSubmit = async (e) => {
    e.preventDefault();
    if (!email || !password) {
      setError('Email dan password harus diisi');
      return;
    }
    const isValidEmail = email.match(/^[\w-]+(\.[\w-]+)*@([\w-]+\.)+[a-zA-Z]{2,7}$/);
    const isValidPassword = password.length >= 6;
    if (!isValidEmail || !isValidPassword) {
      setError('Email atau password tidak valid');
      return;
    }
    const response = await mockLoginApi(email, password);
    if (response.success) {
      localStorage.setItem('isLoggedIn', 'true');
      navigate('/diagnosis');
    } else {
      setError('Login gagal. Periksa email dan password');
    }
  };

  const handleRegisterSubmit = async (e) => {
    e.preventDefault();
    if (!name || !email || !password) {
      setError('Semua field harus diisi');
      return;
    }
    const response = await mockRegisterApi(name, email, password);
    if (response.success) {
      navigate('/login');
    } else {
      setError('Registrasi gagal. Coba lagi nanti');
    }
  };

  const mockLoginApi = (email, password) => {
    return new Promise((resolve) => {
      setTimeout(() => {
        if (email === 'test@example.com' && password === 'password123') {
          resolve({ success: true });
        } else {
          resolve({ success: false });
        }
      }, 1000);
    });
  };

  const mockRegisterApi = (name, email, password) => {
    return new Promise((resolve) => {
      setTimeout(() => {
        resolve({ success: true });
      }, 1000);
    });
  };

  return (
    <Container fluid style={{ height: '100vh', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
      <Row className="w-100">
        <Col md={6} className="d-flex justify-content-center align-items-center">
          <div className="w-75">
            <h3 className="mb-4 text-center">{isLogin ? 'Login' : 'Register'}</h3>

            {error && <Alert variant="danger">{error}</Alert>}

            {isLogin ? (
              <Form onSubmit={handleLoginSubmit}>
                <Form.Group className="mb-3" controlId="formBasicEmail">
                  <Form.Label>Email</Form.Label>
                  <Form.Control
                    type="email"
                    placeholder="Enter email"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    required
                  />
                </Form.Group>

                <Form.Group className="mb-3" controlId="formBasicPassword">
                  <Form.Label>Password</Form.Label>
                  <Form.Control
                    type="password"
                    placeholder="Password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    required
                  />
                </Form.Group>

                <Button variant="primary" type="submit" className="w-100">
                  Login
                </Button>
              </Form>
            ) : (
              <Form onSubmit={handleRegisterSubmit}>
                <Form.Group className="mb-3" controlId="formBasicName">
                  <Form.Label>Full Name</Form.Label>
                  <Form.Control
                    type="text"
                    placeholder="Enter full name"
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                    required
                  />
                </Form.Group>

                <Form.Group className="mb-3" controlId="formBasicEmail">
                  <Form.Label>Email</Form.Label>
                  <Form.Control
                    type="email"
                    placeholder="Enter email"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    required
                  />
                </Form.Group>

                <Form.Group className="mb-3" controlId="formBasicPassword">
                  <Form.Label>Password</Form.Label>
                  <Form.Control
                    type="password"
                    placeholder="Password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    required
                  />
                </Form.Group>

                <Button variant="primary" type="submit" className="w-100">
                  Register
                </Button>
              </Form>
            )}

            <div className="mt-3 text-center">
              <small>
                {isLogin ? "Don't have an account?" : "Already have an account?"}{' '}
                <Button variant="link" onClick={() => setIsLogin(!isLogin)}>
                  {isLogin ? 'Register here' : 'Login here'}
                </Button>
              </small>
            </div>
          </div>
        </Col>

        {/* Column for Image */}
        <Col md={6} className="d-none d-md-flex justify-content-center align-items-center">
          <img
            src="https://via.placeholder.com/500x500"
            alt="Login Illustration"
            style={{ maxWidth: '100%', height: 'auto' }}
          />
        </Col>
      </Row>
    </Container>
  );
}

export default Auth;
